function checkScreenWidth() {
  var wiW = ($('BODY').innerWidth() === window.innerWidth) ? $('BODY').innerWidth() : window.innerWidth;
  if ($('HTML').hasClass('lt-ie9')) {
    var wiW = document.documentElement.clientWidth;
  }
  if (wiW > 1230) {
    $('.header').removeClass('header-mobile header-mobile-deployed');
  } else {
    if (!$('.header').hasClass('header-mobile')) {
      $('.header').addClass('header-mobile');
    }
  }
}

